import "./Child.css";
import { Fragm} from "react";

const Child = () => {
  return (
    <React.Fragment>
    <div className="component">
      <h3>Hello Component</h3>
    </div>
      <h3>Hello Fragment</h3>
      <p>Lorem</p>
    
    </React.Fragment>
  );
};

export default Child;
